import React from "react";
import { Carousel } from "react-bootstrap";
import display from "../Images/apple_shop.png";
import logo_img from "../Images/apple_shop.png";

const MainBody = () => {
  return (
    <div>
      <Carousel>
        <Carousel.Item>
          <img width={"300px"} src={display} />
        </Carousel.Item>
        <Carousel.Item>
          <img width={"300px"} src={logo_img} />
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

export default MainBody;
